import React, { ChangeEvent, useState } from 'react'
import { Container } from 'reactstrap'
import Add from '../../public/Add.svg'
import styles from './admin.module.css'
import { Flex, Form, FormProps, Input } from 'antd'
import { LockOutlined, UserOutlined } from '@ant-design/icons';
import Button from '../Button/index.tsx'

function Admin() {
    const [login, setlogin] = useState('');
    const [password, setPassword] = useState('');
    const [cabinet, setCabinet] = useState('');
    const [window, setWindow] = useState('');
    const [user, setUser] = useState(false)

    function handleAddUser(): void {
        setUser(true)
    }

    type FieldType = {
        login?: string;
        password?: string;
        cabinet?: number;
        window?: number;
    };

    const onFinish: FormProps<FieldType>['onFinish'] = (values) => {
        console.log('Success:', values);
    };

    const onFinishFailed: FormProps<FieldType>['onFinishFailed'] = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };

    function handleWindowInput(e: ChangeEvent<HTMLInputElement>): void {
        const value = e.target.value.replace(/\D/g, "");
        setWindow(value);
    }

    function handleCabinetInput(e: ChangeEvent<HTMLInputElement>): void {
        const value = e.target.value.replace(/\D/g, "");
        setCabinet(value);
    }

    return (
        <Container className='d-flex flex-column align-items-center justify-content-center'>
            <h1>Панель управления</h1>
            <Container>
                <h3>Управление кабинетами</h3>
                <img className={styles.image} src={Add} onClick={handleAddUser}></img>
                {user && <Form
                    name="normal_login"
                    className={styles.loginForm}
                    layout="inline"
                    style={{ fontSize: '22px' }}
                    onFinish={onFinish}
                    onFinishFailed={onFinishFailed}
                    autoComplete="off"
                >

                    <Form.Item<FieldType>
                        label="Логин"
                        name="login"
                        className='d-flex flex-column justify-content-center'
                        rules={[{ required: true, message: 'Введите логин!' }]}
                    >
                        <Input
                            prefix={<UserOutlined className="site-form-item-icon" />}
                            placeholder="Логин"
                            style={{ fontSize: '16px' }}
                            value={login}
                            onChange={(e) => setlogin(e.target.value)} />
                    </Form.Item>

                    <Form.Item<FieldType>
                        label="Пароль"
                        name="password"
                        className='d-flex flex-column justify-content-center'
                        rules={[{ required: true, message: 'Введите пароль!' }]}

                    >
                        <Input.Password
                            prefix={<LockOutlined className="site-form-item-icon" />}
                            value={password}
                            placeholder="Пароль"
                            style={{ fontSize: '16px' }}
                            onChange={(e) => setPassword(e.target.value)} />
                    </Form.Item>

                    <Form.Item<FieldType>
                        label="Кабинет"
                        name="cabinet"
                        
                        className='d-flex flex-column justify-content-center'
                        rules={[{ required: true, message: 'Введите Кабинет!' }]}
                    >
                        <Input
                            prefix={<UserOutlined className="site-form-item-icon" />}
                            placeholder="Кабинет"
                            type='number'
                            style={{ fontSize: '16px' }}
                            value={cabinet}
                            onChange={handleCabinetInput} />
                    </Form.Item>

                    <Form.Item<FieldType>
                        label="Окно"
                        name="window"
                        className='d-flex flex-column justify-content-center'
                        rules={[{ required: true, message: 'Введите окно!' }]}
                    >
                        <Input
                            prefix={<LockOutlined className="site-form-item-icon" />}
                            value={window}
                            placeholder="Окно"
                            type='number'
                            style={{ fontSize: '16px' }}
                            onChange={handleWindowInput} />
                    </Form.Item>

                    <Form.Item>
                        <Button submit>Сохранить</Button>
                    </Form.Item>
                </Form>}

            </Container>

        </Container>
    )
}

export default Admin
